import 'dart:convert';

import 'package:contact_app/src/repo/contact_model.dart';
import 'package:contact_app/src/service_locator.dart';
import 'package:flutter_test/flutter_test.dart';

void main() {
  setUp(() async {
    await ServiceLocator.instance.contactsRepository.initialize();
  });
  test("Contact test", () async {
    String image = "";
    ContactModel contactModel = await ServiceLocator.instance.contactsRepository.addContact(
        firstName: "snehilx",
        lastName: "smith",
        phoneNumber: "7022617211",
        avatar: base64Decode(image));
    dynamic res = await () async { await contactModel.delete(); return true; }();
    expect(res, true);

  });
}
